import { Absence } from "./absence.model";
import { Test } from "./test.model";

export class Student {
    id: number;
    name: string;
    family: string;
    addres: string;
    phon: string;
    works: boolean;
    avg: number;
    dateLeave?: Date;
    active?: boolean;
    year?: YearS;
    tests?: Test[];
    absenceDays?: Absence[];
    constructor(name: string = "", id: number = 0, family: string, addres: string, phon: string, works: boolean, avg: number, dateLeave: Date, tests: Test[], absenceDays: Absence[]) {
        this.id = id;
        this.name = name;
        this.addres = addres;
        this.avg = avg;
        this.phon = phon;
        this.works = works;
        this.family = family;
        this.dateLeave = dateLeave;
        this.tests = tests;
        this.absenceDays = absenceDays;
    }

}

export enum YearS {
    First,
    Second,
    Third
}
